And then the toes as well!

Stiff ankles?
Spend more time in end range dorsiflexion (feet toward the shin)
But don’t neglect ankle planarflexion either!!
(pointed toes)

Knees holding you back?!
This towel up in the crease of your knee can help to relieve pressure, open up the joint, and provide a nice little mobilization as you work those ankles 🙌

